script: |
  super -f text -I q5742.spq | sort > q5742.out

inputs:
  - name: q5742.spq
    data: |
      SELECT - col2 FROM tab2 (FORMAT parquet) WHERE + col0 NOT BETWEEN - 66 * - col2 - ( col0 ) * col0 AND + 11;
  - name: tab2

outputs:
  - name: q5742.out
    data: |
      -23
      -40
      -58
